import logo from './logo.svg';
import './styles/App.css';
import { Route, Routes } from "react-router-dom";
import Home from "./pages/Home.jsx";

function App() {
  return (
      <div>
        <Routes>
          <Route path="/" element={<Home/>}/>
        </Routes>
      </div>
  );
}

export default App;
